// src/components/About.js
import React from 'react';
import './About.css';

const About = () => (
    <section id="about">
        <div className="section_pic-container">

        </div>
        <h2>Hey, I'm </h2>
        <div className="coloured">Lauren!</div>
        <p>I'm a software developer trying to expand their skills and knowledge in the cloud and front-end engineering space.</p>
    </section>
);

export default About;
